import React, {Document} from 'react';
import Layouts from '../Layout';
import LoginRegisterLayouts from '../LoginRegister';
import PortalLayout from '../PortalLayout';
import {BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import { Component } from 'react';
// import axios from 'axios';

// ROUTE CONTROLLER

//Portal
import LoginRegister from '../portal/auth/Login';
import FormWarga from '../portal/form/FormWarga';

//Dashboard
import Pengunjung from '../module/dashboard/Pengunjung';
import Pengguna from '../module/dashboard/Pengguna';
import FormKeluarga from '../portal/form/FormKeluarga';
import axios from 'axios';


const routingList =[
    {
        'path': '/dusunbambu/fromwarga',
        'comp': FormWarga,
        'layout': PortalLayout
    },
    {
        'path': '/dusunbambu/formkeluarga',
        'comp': FormKeluarga,
        'layout': PortalLayout
    },
    //Auth Login
    {
        'path': '/login',
        'comp': LoginRegister,
        'layout': LoginRegisterLayouts
    },
    //End Auth Login
    {
        'path': '/dashboard/pengunjung',
        'comp': Pengunjung,
        'layout': Layouts
    },
    {
        'path': '/dashboard/pengguna',
        'comp':  Pengguna,
        'layout': Layouts
    },

    // Master 
];


const AppRoute = ({component:Component, layout:Layout, title:Title, ...rest})=>
(
    <Route {...rest} render={props=>(
        <Layout>
            <Component {...props}></Component>
        </Layout>
    )}>

    </Route>
)

const MappingRoute =  routingList.map((items)=>{
    // console.log(items);
    return(
        <AppRoute path={items.path} layout={items.layout} exact title="Dashboard" component={items.comp} />

    );
});

class RouterApp extends Component{
    componentDidMount(){

        const config={
            headers:{
                'Authorization':'Bearer '+localStorage.getItem('token'),
            }
        }
        // console.log(config);
        if(config){
            axios.get('/api/me', config).then(
                res=>{
                    // return <Redirect to='/dashboard/pengunjung'  />
                    this.props.history.push('/dashboard/pengunjung')
                },
                err=>{
                    console.log(err)
                }
            );
            // axios.get('user', config).then{
            //     res=>{
            //         console.log(res)
            //     },
            //     err=>{

            //         console.log(err)
            //     }
            // }
        }
    }
    constructor(props){
        super(props);

    }
    render(){

        // console.log(MappingRoute);
        return(
            <Router>
                <Switch>

                    <AppRoute path='/' layout={LoginRegisterLayouts} exact title="Dashboard Pengunjung" component={LoginRegister} />
                    {MappingRoute}

                </Switch>
            </Router>
        );
    }
}

export default RouterApp;
